mber of clicks on links to an app store in your ads.","attention_events_per_impression":"The number of times people paid more attention to your ads than they usually do to other posts and ads they see on Facebook or Instagram divided by the total number of impressions.","attention_events_unq_per_reach":"The number of people who paid more attention to your ads than they usually do to other posts they see on Facebook divided by the number of people you reached with your ads.","attention_score":"A score represented how your audience paid attention to your ad.","audience":"The audience you selected for your ad set. Your audience reflects the people you want to target.","body_asset":"The id of the body asset involved in impression, click or action.","call_to_action_asset":"The id of the call to action asset involved in impression, click or action.","call_to_action_clicks":"The number of times people clicked the call-to-action button on your ad.","campaign_bid_type":"The bid type of your ad set.","campaign_bid_value":"The bid value of your ad set.","campaign_budget_type":"The budget type of your ad set. Its value can be daily or lifetime.","campaign_budget_value":"The budget value of your ad set.","campaign_delivery":"This tells you if your ad set is currently running.","campaign_end":"The date your ad set is scheduled to stop.","campaign_group_delivery":"This tells you if your campaign is currently running.","campaign_group_end":"The date your campaign is scheduled to stop.","campaign_group_id":"The unique ID number of the ad campaign you're viewing in reporting. Your campaign contains ad sets and ads.","campaign_group_name":"The name of the ad campaign you're viewing in reporting. Your campaign contains ad sets and ads.","campaign_group_start":"The date your campaign is scheduled to start.","campaign_id":"The unique ID of the ad set you're viewing in reporting. An ad set is a group of ads that share the same budget, schedule, delivery optimization and targeting.","campa