ed.","cost_per_result":"The average cost per result from your ads.","cost_per_store_visit":"The average cost of each store visit.","cost_per_total_action":"The average cost of a relevant action.","cost_per_unique_click":"The average cost for each unique click (all).","cost_per_unique_inline_link_click":"The average cost of each unique inline link click.","country":"The countries where the people you've reached are located. This is based on information such as a person's hometown, their current city and the geographical location where they tend to be when they visit Facebook.","cpc":"The average cost for each click (all).","cpm":"The average cost for 1,000 impressions.","cpp":"The average cost to reach 1,000 people.","ctr":"The percentage of times people saw your ad and performed a click (all).","cumulative_reach":"The number of people who saw your ads at least once over the lifetime of your campaign.","date_start":"The start date for your data. This is controlled by the date range you've selected for your reporting view.","date_stop":"The end date for your data. This is controlled by the date range you've selected for your reporting view.","deduping_1st_source_ad":"This is the ad set that has the highest audience overlap with the selected ad set, which results in high auction removal rate.","deduping_1st_source_ratio":"This is the auction removal rate for the ad set with the highest amount of audience overlap with the selected ad set.","deduping_2nd_source_ad":"This is the ad set that has the second highest audience overlap with the selected ad set, which results in high auction removal rate.","deduping_2nd_source_ratio":"This is the auction removal rate for the ad set with the second highest amount of audience overlap with the selected ad set.","deduping_3rd_source_ad":"This is the ad set that has the third highest audience overlap with the selected ad set, which results in high auction removal rate.","deduping_3rd_source_ratio":"This is the auction removal rate for the ad set with the third highest amount of audience overlap with the selected ad set.","deduping_ratio":"The total auction removal rate is the percentage of auctions that an ad set did not compete in due to audience overlap with other ad sets.","deeplink_clicks":"The number of clicks on links to specific parts of an app.","description_asset":"The id of the description asset involved in impression, click or action.","device_platform":"The type of device, mobile or desktop, used by people when they viewed or clicked on an ad, as shown in ads reporting.","dma":"DMA (Designated Market Area) regions are the 210 geographic areas in the United States in which local television viewing is measured by The Nielsen Company","dwell_3_sec":"The number of times your ad was viewed for more than 3 seconds.","dwell_5_sec":"The number of times your ad was viewed for more than 5 seconds.","dwell_7_sec":"The number of times your ad was viewed for more than 7 seconds.","estimated_ad_recallers":"An estimate of the number of additional people who may remember seeing your ads, if asked, within 2 days. This metric shows results for ads using brand awareness, video views and Page post engagement objectives.","estimated_ad_recallers_lower_bound":"The lower bound on esimtated number of people who will recall seeing your ad.","estimated_ad_recallers_upper_bound":"The upper bound on esimtated number of people who will recall seeing your ad.","estimated_ad_recall_rate":"The rate at which an estimated number of additional people, when asked, would remember seeing your ads within 2 days.","estimated_ad_recall_rate_lower_bound":"The lower bound on estimated percentage of people who recall your ad divided by the number of people your ad reached.","estimated_ad_recall_rate_upper_bound":"The upper bound on estimated percentage of people who recall your ad divided by the number of people your ad reached.","frequency":"The average number of times each person saw your ad.","frequency_value":"The number 