ed on Facebook, for example on Newsfeed on a mobile device.","place_page_id":"The id of the place page involved in impression or click.","place_page_name":"The name of the place page involved in impression or click. Has to be used together with Business Locations breakdown.","platform_position":"Where your ad was shown within a platform, for example on Facebook desktop News Feed, Instagram mobile News Feed.","product_id":"The id and name of the product involved in impression, click or action.","publisher_platform":"Which platform your ad was shown, for example on Facebook, Instagram, Audience Network.","reach":"The number of people who saw your ads at least once. Reach is different from impressions, which may include multiple views of your ads by the same people.","region":"The regions where the people you've reached are located. This is based on information such as a person's hometown, their current city and the geographical location where they tend to be when they visit Facebook.","relevance_score":"A rating from 1 to 10 that estimates how well your target audience is responding to your ad. This score is shown after your ad receives more than 500 impressions. It's only visible when looking at reporting for ads and does not appear for ad sets and campaigns.","results":"The number of times your ad achieved an outcome, based on the objective you selected.","result_rate":"The percentage of results you received out of all the views of your ads.","social_clicks":"The number of clicks (all) when your ad was displayed with social information, which shows other Facebook friends who engaged with your Facebook Page or ad.","social_impressions":"The number of times your ads were viewed when displayed with social information, which shows Facebook friends who engaged with your Facebook Page or ad.","social_reach":"The number of people who saw your ad when displayed with social information, which shows other Facebook friends who engaged with your Facebook Page or ad.","spend":"T